import "./CreateDesigner.css";
import axios from 'axios';
import React, { useEffect, useState,} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    NavLink,
    Link
  } from "react-router-dom";
    
  function CreatePlanta() {

    const [designs, setDesigns] = useState([]);
    useEffect(() => {
        (async () => {
            const res = await axios.get(`http://localhost:8090/api/GetDesignsData`, {
            });
            setDesigns(res.data);
        })()
    },[])

    return (
    <div className="Corporativo">
        <div className="marco">
            <Link to={`/CrearDesign`}>
                <button>Crear Diseño</button>
            </Link>
            <Link to={`/ModificarDesign`}>
                <button>Modificar Diseño</button>
            </Link>
            <Link to={`/EliminarDesign`}>
                <button>Eliminar Diseño</button>
            </Link>
        </div>
        <div className="Tabla">
          <div className="div-c">
              <div className="div-nuevo2">
                  <table id="customers">
                      <thead>
                        <tr>
                            <th>Nombre Diseño</th>
                            <th>Nombre Diseñador</th>
                            <th>Tipo Vehiculo</th>
                            <th>Trasmision</th>
                            <th>Material Asientos</th>
                            <th>Motor</th>
                            <th>Vidrios Electricos</th>
                            <th>Espejos Electricos</th>
                            <th>Sensor Aproximacion Traseros</th>
                            <th>Sensor Aproximacion Delanteros</th>
                        </tr>
                      </thead>
                  { 
                      designs.map(design => (
                          <tbody>
                              <tr>
                                  <td>{design.nombredesgn}</td>
                                  <td>{design.idDesigner}</td>
                                  <td>{design.idTipoV}</td>
                                  <td>{design.trasmision}</td>
                                  <td>{design.material_asientos}</td>
                                  <td>{design.motor}</td>
                                  <td>{design.vidrios_electricos}</td>
                                  <td>{design.espejos_electricos}</td>
                                  <td>{design.sensoresProx_traseros}</td>
                                  <td>{design.sensoresProx_delanteros}</td>
                              </tr>     
                          </tbody>
                      ))
                  }
                  </table>
              </div>
          </div>
        </div>
    </div>
    );
  }
  
  export default CreatePlanta;
